import React from "react";
import "./style.css";
import github from '../../utils/images/icons/github.png';
import linkedin from '../../utils/images/icons/linkedin.png'

const footerIcon = {
  width: '60px'
}

function Footer() {
  return (
      <div>
        <div id='footer'>
          <div id='footer-icon-tray'>
            <img style={footerIcon} src={github}></img>
            <img style={footerIcon} src={linkedin}></img>
          </div>
        </div>
      </div>
  );
}

export default Footer;
